import './Tasks.scss'

const Tasks = ({ showModal }) => {

    {showModal && (
        <div className="modal">
          <div className="modal-content">
          </div>
        </div>
      )}

    return (
        <div className='tasks'>
            <Task></Task>
            <Button 
                onClick={showModal}
            >
            </Button>
            <Modal />
        </div>
    );
};

